import { Outlet, Route, Routes } from "react-router-dom"
import { BookingForm } from "../booking/BookingForm"
import { MyRequest } from "../booking/MyRequest"
import { Login } from "../auth/Login"
import { Register } from "../auth/Register"
import "./ApplicationViews.css"

export const ClientViews = () => {

    // const localFatBackUser = localStorage.getItem("fatback_user")
    // const fatbackUserObject = JSON.parse(localFatBackUser)

    return (
        <Routes>
            <Route path="*" element={
			<Authorized>
				<>
					<NavBar />
					<ApplicationViews />
				</>
			</Authorized>

		} />
            <Route path="/" element={
                <div className="views">
                    <h1 className="title-main">FatBack Studio</h1>


                    <Outlet />
                </div>
            }>

                <Route path="reserve" element={<BookingForm />} />
                <Route path="myrequest/:clientId" element={<MyRequest />} />

            </Route>
        </Routes>
    )
}
